CREATE TABLE PRODUCCIONS(
CODIGO VARCHAR(10) NOT NULL,
DESCRICION VARCHAR(250),
FAMILIA VARCHAR(250),
PRIMARY KEY (CODIGO)
);



CREATE TABLE UBICACIONS(
CODIGO VARCHAR(10) NOT NULL,
DESCRICION VARCHAR(250),
FASE VARCHAR(250),
PRIMARY KEY (CODIGO)
);



create table seccions (
  id_seccion number not null,
  nome_seccion varchar(255) not null,
  
  id_usuario_modificacion number DEFAULT NULL,
  data_modificacion timestamp NOT NULL,

  primary key (id_seccion)
);

create sequence SEQ_SECCIONS
  START WITH     11
  INCREMENT BY   1
  NOCACHE
  NOCYCLE;


  
--FIXME: 
--¿Seguro que no se dispone ya de la tabla seccions?
--Sería más correcto añadir a la vista ubicacions el id de la seccion 

create table seccions_ubicacions (
	id_seccion number not null,
	id_ubicacion varchar(10) not null,
	
	primary key (id_seccion, id_ubicacion),
	constraint fk_seccion_ubicacion_1 foreign key (id_seccion) references seccions (id_seccion),
	constraint fk_seccion_ubicacion_2 foreign key (id_ubicacion) references ubicacions (codigo)
);






CREATE TABLE TRABALLADORES(
DNI VARCHAR(10) NOT NULL,
NOME VARCHAR(250),
APELIDO1 VARCHAR(250),
APELIDO2 VARCHAR(250),
CATEGORIA VARCHAR(250),
PRIMARY KEY (DNI)
);



CREATE TABLE ESTADOS(
CODIGO VARCHAR(10) NOT NULL,
DESCRICION VARCHAR(250),
ACTIVO VARCHAR(250),
AFECTA VARCHAR(250),
PRORRATEADO VARCHAR(250),
DIAS VARCHAR(250),
ESTADIS VARCHAR(250),
HORAS VARCHAR(250),
COD_SGE VARCHAR(250),
SGE VARCHAR(250),
TORNO VARCHAR(250),
PRIMARY KEY (CODIGO)
);






create table festivos(
	id_festivo number(10) not null,
	data date not null,
	festividade varchar(250), 
	
	id_usuario_modificacion number DEFAULT NULL,
	data_modificacion timestamp NOT NULL,

	primary key (id_festivo)
);



create table festivos_ubicacions (
	id_festivo_ubicacion number(10) not null,
	id_festivo number(10) not null,
	id_ubicacion varchar(10) not null,
  
	id_usuario_modificacion number DEFAULT NULL,
	data_modificacion timestamp NOT NULL,
  
	primary key (id_festivo_ubicacion),
	constraint fk_festivos foreign key (id_festivo) references festivos (id_festivo),
	constraint fk_ubicacions foreign key (id_ubicacion) references ubicacions (codigo)	
);

COMMENT ON TABLE festivos_ubicacions IS 'Tabla coas relacions festivos-ubicación';















create table definicions_horarios (
  id_definicion number not null,
  id_traballador varchar(10) not null,  
  data_desde date not null,
  data_ata date not null,
  aplica_luns char(1) default '0',
  aplica_martes char(1) default '0',
  aplica_mercores char(1) default '0',
  aplica_xoves char(1) default '0',
  aplica_venres char(1) default '0',
  aplica_sabado char(1) default '0',
  aplica_domingo char(1) default '0',  
  num_semanas_alternar number(2),
  hora_desde date not null,
  hora_ata date not null,
  id_ubicacion varchar(10) not null,
  id_produccion varchar(10),  
  cor_horario varchar(10),
  
  id_usuario_modificacion number DEFAULT NULL,
  data_modificacion timestamp NOT NULL,  

  primary key (id_definicion),
  constraint definicion_traballador_unique unique (id_traballador, data_desde, data_ata, hora_desde, hora_ata),
  constraint fk_definicions_ubicacions foreign key (id_ubicacion) references ubicacions (codigo),
  constraint fk_definicions_traballadores foreign key (id_traballador) references traballadores (dni),
  constraint fk_definicions_produccions foreign key (id_produccion) references produccions (codigo)
);  

create sequence SEQ_DEFINICIONS_HORARIOS 
  START WITH     1
  INCREMENT BY   1
  NOCACHE
  NOCYCLE;
  
create table excepcions_horarios (
  id_excepcion number not null,
  id_estado varchar(10) not null,
  descricion varchar(255),
  
  id_sustituto varchar(10),
  estado_contrato number(10),
  
  id_usuario_modificacion number DEFAULT NULL,
  data_modificacion timestamp NOT NULL,
  
  primary key (id_excepcion),  
  constraint fk_excepcions_estados foreign key (id_estado) references estados (codigo),
  constraint fk_excepcions_sustitutos foreign key (id_sustituto) references traballadores (dni)
 );

COMMENT ON COLUMN excepcions_horarios.estado_contrato IS 'Estado del contrato del sustituto, 1=solicitado, 2=confirmado';
 
create sequence seq_excepcions_horarios
  START WITH     1
  INCREMENT BY   1
  NOCACHE
  NOCYCLE;   
  
create table horarios_horas (
  id_horas_dia number not null,
  data_dia date not null,
  id_ubicacion varchar(10) not null,
  id_traballador varchar(10) not null,
  id_produccion varchar(10),
  
  hora_desde date not null,
  hora_ata date not null,
  
  id_definicion number,
  id_excepcion number,
  
  id_usuario_modificacion number DEFAULT NULL,
  data_modificacion timestamp NOT NULL,
  
  primary key (id_horas_dia),
  constraint horas_traballador_unique unique (id_traballador, data_dia, id_ubicacion, hora_desde, hora_ata),
  constraint fk_horas_ubicacion foreign key (id_ubicacion) references ubicacions (codigo),
  constraint fk_horas_traballadores foreign key (id_traballador) references traballadores (dni),
  constraint fk_horas_producciones foreign key (id_produccion) references produccions (codigo),
  constraint fk_horas_excepcions foreign key (id_excepcion) references excepcions_horarios (id_excepcion),
  constraint fk_horas_definicions foreign key (id_definicion) references definicions_horarios (id_definicion)
);

create sequence seq_horarios_horas 
  START WITH     1
  INCREMENT BY   1
  NOCACHE
  NOCYCLE;  






 

